import React from "react";
import Header from "./components/Header";
import Intro from "./components/Intro";
import Footer from "./components/Footer";


class App extends React.Component {
  render() {
    return (
      <div className='wrapper'>

        <Header/>
        <Intro/>
        <Footer/>

      </div>
    );
  }
}

export default App;
